import { StyleSheet} from 'react-native';

const loginPageStyles = StyleSheet.create({
    button: {
      backgroundColor: "#1e2833",
      padding:10,
      margin:10,
      borderRadius:5,
      opacity:1,
    },
    buttonText: {
      fontSize: 20,
      backgroundColor:'#fff'
    },
    text: {
      fontSize:15,
      marginTop:10,
      marginBottom:10,
    },
    input: {
      height: 40,
      margin:5,
      borderWidth:1,
      padding:5,
      width: 200,
      textAlign: 'center',
      borderColor:'#FDFEFE',
      borderRadius:5,
      backgroundColor: '#003247',
    },
    istorage:{
      fontSize:30,
      marginBottom:20,
      fontFamily:"Cochin-Italic",
    }
  });
export {loginPageStyles};
